import React, { useState } from 'react';
import { Container } from 'react-bootstrap';
import { useSelector } from 'react-redux';

function Cart() {
    const list = useSelector((state) => state.cart.product)
    const image = '../' + list[0].image
    return (
    <div> 
    
       
        <Container className='text-center ms-2 '><h1>CARTPAGE</h1></Container>
         {list.map( item =>
            <div>
        <div><img src={image} /></div>
        <p>{item.name}</p>
        <p>{item.price}</p>
        </div>)
       
}
    </div>
      );
}

export default Cart;
